    {
      "lineNumber": 255532,
      "originalJapaneseLine": "君をこんなに愛している俺も憎いか？",
      "translatedEnglishLine": "Do you hate me for loving you this much?"
    },
    {
      "lineNumber": 255533,
      "originalJapaneseLine": "恋をろくにしらず、告白された事など毛頭ないニミッツは陥落",
      "translatedEnglishLine": "Nimitz, inexperienced in love and never having been confessed to, falls."
    },
    {
      "lineNumber": 255534,
      "originalJapaneseLine": "※この流れキャラ性にあわせて自由に変更して下さい",
      "translatedEnglishLine": "* Please freely modify this sequence to match the character’s personality."
    },
    {
      "lineNumber": 255535,
      "originalJapaneseLine": "※ようは仲間になればいいので",
      "translatedEnglishLine": "* The main point is that they just need to become an ally."
    },
    {
      "lineNumber": 255536,
      "originalJapaneseLine": "翌日、戦場",
      "translatedEnglishLine": "The next day, on the battlefield."
    },
    {
      "lineNumber": 255537,
      "originalJapaneseLine": "魔物大将軍ヨシフは信じられないものを見る",
      "translatedEnglishLine": "The great demon general Yosif sees something unbelievable."
    },
    {
      "lineNumber": 255538,
      "originalJapaneseLine": "魔人レキシントンが人間側にいた。",
      "translatedEnglishLine": "The demon Lexington was on the humans' side."
    },
    {
      "lineNumber": 255539,
      "originalJapaneseLine": "おのれ・・とヨシフは突撃を命じるが、魔物達は浮き足立ち",
      "translatedEnglishLine": "“Damn them...” Yosif orders an assault, but the demons become unsettled."
    },
    {
      "lineNumber": 255540,
      "originalJapaneseLine": "すぐに敗走していった。",
      "translatedEnglishLine": "They soon fled in defeat."
    },
    {
      "lineNumber": 255541,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 255542,
      "originalJapaneseLine": "戦いの後",
      "translatedEnglishLine": "After the battle."
    },
    {
      "lineNumber": 255543,
      "originalJapaneseLine": "ニミッツは、ランスに彼女がいっぱい居る事を知って怒るが",
      "translatedEnglishLine": "Nimitz learns that Lance has many girlfriends and gets angry, but"
    },
    {
      "lineNumber": 255544,
      "originalJapaneseLine": "もうどうでもよくなり、一緒に行動する事となる",
      "translatedEnglishLine": "soon stops caring and decides to act together with him."
    },
    {
      "lineNumber": 255545,
      "originalJapaneseLine": "\t\tかなみか誰かが情報を聞く",
      "translatedEnglishLine": "\t\tKanami or someone else hears some information."
    },
    {
      "lineNumber": 255546,
      "originalJapaneseLine": "\t\tさきほどいかなかったアペムンタ村は皆殺しになったと報告",
      "translatedEnglishLine": "\t\tIt is reported that Apemunta Village, which they hadn’t gone to earlier, was completely massacred."
    },
    {
      "lineNumber": 255547,
      "originalJapaneseLine": "\t\t本来、そんな村に無体な事は無意味なのに不思議な事だと",
      "translatedEnglishLine": "\t\tNormally, it would be pointless to do such cruelty to a village like that; it’s a strange matter."
    },
    {
      "lineNumber": 255548,
      "originalJapaneseLine": "\t\t憎しみがあったように一人も逃がさず・・",
      "translatedEnglishLine": "\t\tIt was as if there was hatred, not letting a single person escape..."
    },
    {
      "lineNumber": 255549,
      "originalJapaneseLine": "\t\t他の村にはそういう事は無いです",
      "translatedEnglishLine": "\t\tSuch things did not happen in other villages."
    },
    {
      "lineNumber": 255550,
      "originalJapaneseLine": "\t\t何かあったのかな・・",
      "translatedEnglishLine": "\t\tI wonder if something happened..."
    },
    {
      "lineNumber": 255551,
      "originalJapaneseLine": "\t\tカクテル迷宮の入り口に来た",
      "translatedEnglishLine": "\t\tThey arrive at the entrance of the Cocktail Labyrinth."
    },
    {
      "lineNumber": 255552,
      "originalJapaneseLine": "\t\tいつもなら人気で入場制限がある場所だが",
      "translatedEnglishLine": "\t\tNormally, this place is so popular that there are entry restrictions,"
    },
    {
      "lineNumber": 255553,
      "originalJapaneseLine": "\t\tガラガラ",
      "translatedEnglishLine": "\t\tbut now it’s practically empty."
    },
    {
      "lineNumber": 255554,
      "originalJapaneseLine": "\t\t中に入ります",
      "translatedEnglishLine": "\t\tThey enter inside."
    },
    {
      "lineNumber": 255555,
      "originalJapaneseLine": "\t\tベゼルアイが幸福きゃんきゃんの逸話をしてくれる",
      "translatedEnglishLine": "\t\tBezel Eye tells an anecdote about the 'Happy Kyankyankii'."
    },
    {
      "lineNumber": 255556,
      "originalJapaneseLine": "\t\tＸＸＸＸネタ未定",
      "translatedEnglishLine": "\t\tXXXX plot/subject undecided."
    },
    {
      "lineNumber": 255557,
      "originalJapaneseLine": "\t\t幸福きゃんきゃんを発見する、追いかける・・",
      "translatedEnglishLine": "\t\tThey discover the Happy Kyankyankii and start chasing it..."
    },
    {
      "lineNumber": 255558,
      "originalJapaneseLine": "\t\tゆるして、ゆるして・・",
      "translatedEnglishLine": "\t\t\"Forgive me, forgive me...\""
    },
    {
      "lineNumber": 255559,
      "originalJapaneseLine": "\t\tうーん、倒す",
      "translatedEnglishLine": "\t\tHmm, defeat it."
    },
    {
      "lineNumber": 255560,
      "originalJapaneseLine": "さぁ、もっと倒すぞ",
      "translatedEnglishLine": "Now, let's defeat even more."
    },
    {
      "lineNumber": 255561,
      "originalJapaneseLine": "戦闘中イベント、キラトーキ、第１ターン",
      "translatedEnglishLine": "Battle event: Kiratoki, Turn 1."
    },
    {
      "lineNumber": 255562,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 255563,
      "originalJapaneseLine": "「ちっ、人間共め、また現れやがったのか",
      "translatedEnglishLine": "\"Tch, you humans... you showed up again,\""
    },
    {
      "lineNumber": 255564,
      "originalJapaneseLine": "　何度言えば、わかるんだ。",
      "translatedEnglishLine": "How many times do I have to say it for you to understand?"
    },
    {
      "lineNumber": 255565,
      "originalJapaneseLine": "　まだ早いんだよ」",
      "translatedEnglishLine": "\"It's still too early.\""
    },
    {
      "lineNumber": 255566,
      "originalJapaneseLine": "「ここの幸福きゃんきゃんはまだ幼い",
      "translatedEnglishLine": "\"The Happy Kyankyankii here are still young."
    },
    {
      "lineNumber": 255567,
      "originalJapaneseLine": "　もっと時間をかけて養殖して太らせてグラマーにしてから",
      "translatedEnglishLine": "They need more time to be farmed, fattened, and made glamorous."
    },
    {
      "lineNumber": 255568,
      "originalJapaneseLine": "　ちっ、言ってもわからねぇか、目先の事しか考えねぇ人間共め",
      "translatedEnglishLine": "Tch, I guess you won’t understand even if I say so, you humans only think about the short term."
    },
    {
      "lineNumber": 255569,
      "originalJapaneseLine": "　力で教えてやるしかないな」",
      "translatedEnglishLine": "\"I have no choice but to teach you with force.\""
    },
    {
      "lineNumber": 255570,
      "originalJapaneseLine": "戦闘中イベント、キラトーキ、ＨＰ２０％以下",
      "translatedEnglishLine": "Battle event: Kiratoki, below 20% HP."
    },
    {
      "lineNumber": 255571,
      "originalJapaneseLine": "だいぶ戦闘が進み、ランス達が有利、キラトーキがピンチ",
      "translatedEnglishLine": "The battle has progressed considerably, Lance and his group have the advantage, Kiratoki is in trouble."
    },
    {
      "lineNumber": 255572,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 255573,
      "originalJapaneseLine": "強いな、力で上級神の地位を奪い取ってやろうとする俺を圧倒するとは・・",
      "translatedEnglishLine": "You're strong, to think you overwhelm me trying to seize the position of a high god by force..."
    },
    {
      "lineNumber": 255574,
      "originalJapaneseLine": "そうか、わかったぞ、大量の幸福きゃんきゃんを狩って強くなっていたのか",
      "translatedEnglishLine": "I see, I understand now—you became stronger by hunting a large number of Happy Kyankyankii."
    },
    {
      "lineNumber": 255575,
      "originalJapaneseLine": "くそっ、こっちは狩らずに育つのを待っていたのに横取りしやがって",
      "translatedEnglishLine": "Damn it, I was waiting for them to grow without hunting them, but you stole them."
    },
    {
      "lineNumber": 255576,
      "originalJapaneseLine": "ゆるさねぇ",
      "translatedEnglishLine": "I won't forgive you."
    },
    {
      "lineNumber": 255577,
      "originalJapaneseLine": "今日は、残念ながら俺の負けかもしれない",
      "translatedEnglishLine": "Today, unfortunately, I might lose."
    },
    {
      "lineNumber": 255578,
      "originalJapaneseLine": "だが、お前はゆるさない、覚えておけ",
      "translatedEnglishLine": "But I won't forgive you, remember that."
    },
    {
      "lineNumber": 255579,
      "originalJapaneseLine": "\t\t規定数を倒したので外に強制的に出される",
      "translatedEnglishLine": "\t\tAfter defeating the required number, they are forcibly pushed outside."
    },
    {
      "lineNumber": 255580,
      "originalJapaneseLine": "ランスは激戦の末、レキシントンを倒した。",
      "translatedEnglishLine": "After a fierce battle, Lance defeated Lexington."
    },
    {
      "lineNumber": 255581,
      "originalJapaneseLine": "火力と体力だけは立派だが、経験不足だな。",
      "translatedEnglishLine": "Only firepower and stamina are impressive, but lacking experience."
    },
    {
      "lineNumber": 255582,
      "originalJapaneseLine": "俺様の敵ではないわ。",
      "translatedEnglishLine": "He is no match for me."
    },
    {
      "lineNumber": 255583,
      "originalJapaneseLine": "レキシントン（ニミッツ）は怯え・・",
      "translatedEnglishLine": "Lexington (Nimitz) becomes frightened..."
    },
    {
      "lineNumber": 255584,
      "originalJapaneseLine": "さーて、やるぞと傷付き動けないレキシントンに乗りかかるランス",
      "translatedEnglishLine": "Alright, let's do this—Lance mounts the wounded, immobile Lexington."
    },
    {
      "lineNumber": 255585,
      "originalJapaneseLine": "犯そうとした所で、ニミッツの魂は恐怖で逃げてしまい、元のレキシントンの魂が蘇る",
      "translatedEnglishLine": "Just as he tries to violate him, Nimitz’s soul flees in fear, and the original Lexington’s soul is revived."
    },
    {
      "lineNumber": 255586,
      "originalJapaneseLine": "ランスを押しのけるレキシントン",
      "translatedEnglishLine": "Lexington pushes Lance away."
    },
    {
      "lineNumber": 255587,
      "originalJapaneseLine": "雰囲気がいっきにおっさんくさくなる。",
      "translatedEnglishLine": "The atmosphere suddenly becomes very old-man-like."
    },
    {
      "lineNumber": 255588,
      "originalJapaneseLine": "ランス萎える",
      "translatedEnglishLine": "Lance feels deflated."
    },
    {
      "lineNumber": 255589,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 255590,
      "originalJapaneseLine": "アトランタとジュノーが現れて説明する",
      "translatedEnglishLine": "Atlanta and Juno appear and provide an explanation."
    },
    {
      "lineNumber": 255591,
      "originalJapaneseLine": "そうか、女の身体をベースに蘇ったのか・・",
      "translatedEnglishLine": "I see, he was resurrected based on a female body..."
    }
  ]
}

